import React, { Component } from 'react'

export default class Countdown extends Component {
    constructor() {
        super();

    }
    render() {
        return (
            <div style={{ backgroundColor: 'white', margin: '10px', padding: '20px' }}>
                <p>00:00:00</p>
                <button>start countdown</button>
            </div>
        )
    }
}
